import { Menu, Group, Center, Burger, Container } from "@mantine/core";
import { useDisclosure } from "@mantine/hooks";
import { IconChevronDown } from "@tabler/icons-react";
// import { MantineLogo } from '@mantine/ds';
import classes from "./css/HeaderMenu.module.css";

import {
  IconHome2,
  IconWorld,
  IconCategory,
  IconDatabase,
  IconGardenCart,
  IconTruckDelivery,
  IconUser,
  IconSettings,
} from "@tabler/icons-react";

const links = [
  {
    link: "#1",
    icon: <IconHome2 />,
    label: "Home",
    links: [
      { link: "/docs", label: "Documentation" },
      { link: "/resources", label: "Resources" },
      { link: "/community", label: "Community" },
      { link: "/blog", label: "Blog" },
    ],
  },
  {
    link: "#2",
    icon: <IconWorld />,
    label: "Global",
    links: [
      { link: "/docs", label: "App Bar" },
      { link: "/resources", label: "Nav Bar" },
      { link: "/community", label: "Drawer" },
    ],
  },
  {
    link: "#3",
    icon: <IconCategory />,
    label: "Category",
    links: [
      { link: "/docs", label: "Documentation" },
      { link: "/resources", label: "Resources" },
      { link: "/community", label: "Community" },
      { link: "/blog", label: "Blog" },
    ],
  },
  {
    link: "#4",
    icon: <IconDatabase />,
    label: "Product List",
    links: [
      { link: "/docs", label: "Documentation" },
      { link: "/resources", label: "Resources" },
      { link: "/community", label: "Community" },
      { link: "/blog", label: "Blog" },
    ],
  },
  {
    link: "#5",
    icon: <IconGardenCart />,
    label: "Cart",
    links: [
      { link: "/docs", label: "Documentation" },
      { link: "/resources", label: "Resources" },
      { link: "/community", label: "Community" },
      { link: "/blog", label: "Blog" },
    ],
  },
  {
    link: "#6",
    icon: <IconTruckDelivery />,
    label: "Order",
    links: [
      { link: "/docs", label: "Documentation" },
      { link: "/resources", label: "Resources" },
      { link: "/community", label: "Community" },
      { link: "/blog", label: "Blog" },
    ],
  },
  {
    link: "#7",
    icon: <IconUser />,
    label: "Profile",
    links: [
      { link: "/docs", label: "Documentation" },
      { link: "/resources", label: "Resources" },
      { link: "/community", label: "Community" },
      { link: "/blog", label: "Blog" },
    ],
  },
  {
    link: "#8",
    icon: <IconSettings />,
    label: "Settings",
    links: [
      { link: "/docs", label: "Documentation" },
      { link: "/resources", label: "Resources" },
      { link: "/community", label: "Community" },
      { link: "/blog", label: "Blog" },
    ],
  },
];
